// import Index from "./Pages/RouterChallange/Index";
const App = () => {
  const url = "https://api-basketball.p.rapidapi.com/seasons";

  const options = {
    method: "GET",
    headers: {
      "X-RapidAPI-Key": "81d70b4329mshb68add759d57321p1e59e1jsn2506c33db28a",
      "X-RapidAPI-Host": "api-basketball.p.rapidapi.com",
    },
  };

  fetch(url, options)
    .then((res) => res.json())
    .then((json) => console.log(json))
    .catch((err) => console.error("error:" + err));

  return <div>Home</div>;
};

export default App;
